import React from 'react';
import {Link} from 'react-router-dom'
import {FiArrowLeft} from 'react-icons/fi';

import './styles.css';
import logoImg from '../../assets/logo.png';

export default function NewIncident(){
    return (
        <div className="new-incident-container">
            <div className="content">
            <section>
            <img src={logoImg} alt="Cadastro Simples"/>

            <h1>Cadastar</h1>
            <p>Descreva o caso detalhadamente para enconrar um heroi para resolver isso.</p>
            <Link className="back-link" to  = "/"><FiArrowLeft size={16} color="#E02041"/>Voltar para a home </Link> 
            </section>

            <form>
            <input placeholder="Titulo do caso"></input>
            <textarea placeholder="Descrição "></textarea>
            <input placeholder="Valor em reais"></input>
            
            <button className="button" type="submit">Cadastrar</button>

            </form>

            </div>
        </div>
    )
}
